member.summary:
The DesignerHost is a custom implementation of IDesignerHost and ISite, which is needed to hookup any PropertyGrid components used in the UI to enable proper Undo/Redo functionality. Otherwise, when changing the properties of multiple objects at once, the operation is not batched, meaning that the UI will be updated when a property value is set for every object in the selection. This will cause slow updates when many objects are selected, and furthermore, undoing the entire operation is a hassle, as one Undo-action is needed per object.
To set up a PropertyGrid to use this host, use the following code:
MyPropertyGrid.Site = new DesignerHost();
